/* eslint-disable no-restricted-syntax */
import * as jsPDF from 'jspdf';
import api from '../../services/Api';
import 'jspdf-autotable';

export default async function GeneratePDF() {
  const doc = new jsPDF();

  const capa =
    'data:image/jpeg;base64,';

  const response = await api.post('/financeiro/gerar_relatorio', {
    token: localStorage.getItem('fmpborToken'),
    ano: new Date().getFullYear(),
  });

  doc.page = 2;
  function footer() {
    const date = new Date();
    doc.setFontSize(8);
    doc.text(
      10,
      285,
      `Gerado em: ${date.getDate()}/${date.getMonth()}/${date.getFullYear()} às ${date.getHours()}:${date.getMinutes()}:${date.getSeconds()}`
    );
    doc.text(200, 285, `Página ${doc.page}`, null, null, 'right'); // print number bottom right
    doc.page++;
    doc.setFontSize(16);
  }

  const dados = response.data;

  const meses = [];
  for (const mes in dados.pagina2) {
    meses[mes] = dados.pagina2[mes];
  }

  // Capa
  doc.setFontSize(61);
  doc.setFont('helvetica');
  doc.addImage(capa, 'JPEG', 0, 0, 210, 297);
  doc.text(`${new Date().getFullYear()}`, 50, 95, null, null, 'center');
  doc.setFontSize(16);
  doc.setFontStyle('normal');
  doc.text(`${dados.pagina1[0].nome}`, 20, 220, null, null);
  doc.text(
    `Formada em: ${dados.pagina1[0].data_organização}`,
    20,
    230,
    null,
    null
  );
  doc.text(`Conselheiro:`, 20, 250, null, null);
  const conselheiro = dados.conselheiro[0].nome;
  const index = conselheiro.indexOf(' ', conselheiro.indexOf(' ') + 1);
  doc.text(
    `${index > -1 ? conselheiro.substr(0, index) : conselheiro}`,
    20,
    260,
    null,
    null
  );
  doc.text(`Telefone: ${dados.conselheiro[0].telefone}`, 20, 270, null, null);

  // Página 1
  const diretoriaLinhas = [];
  dados.diretoria.map(item => {
    const newLinha = [];
    newLinha.push(item.cargo, item.nome, item.telefone, item.email);
    diretoriaLinhas.push(newLinha);
  });

  doc.addPage();
  footer();
  doc.setFontSize(22);
  doc.text(`Diretoria`, 10, 25);
  doc.setFontSize(12);
  doc.autoTable({
    head: [['Cargo', 'Nome', 'Telefone', 'Email']],
    body: diretoriaLinhas,
    startY: 40,
    columnStyles: {
      0: { columnWidth: 50 },
      1: { columnWidth: 50 },
      2: { columnWidth: 30 },
      3: { columnWidth: 50 },
    },
  });

  // Página 2
  const linhas = [];
  for (const mes in meses) {
    const newLinha = [];
    newLinha.push(mes);
    for (const valores in meses[mes]) {
      newLinha.push(meses[mes][valores]);
    }
    linhas.push(newLinha);
  }

  doc.addPage();
  footer();
  doc.setFontSize(22);
  doc.text(`Resumo Mensal`, 10, 25);
  doc.setFontSize(12);
  doc.autoTable({
    head: [['Mês', 'Entradas (R$)', 'Saídas (R$)', 'Saldo (R$)']],
    body: linhas,
    startY: 40,
    minCellWidth: 10,
  });

  // Página 3
  const tTB = document.getElementById('financialTable');
  const atTB = doc.autoTableHtmlToJson(tTB, true);
  const cols = atTB.columns;

  cols.splice(0, 1);
  cols.splice(3, 1);
  cols.pop();
  cols.pop();

  atTB.rows.map(item => {
    item.splice(0, 1);
    item.splice(3, 1);
    item.pop();
    item.pop();
  });

  doc.addPage();
  footer();
  doc.setFontSize(22);
  doc.text(`Descrição detalhada`, 10, 25);
  doc.setFontSize(12);
  doc.autoTable({
    head: [cols],
    body: atTB.rows,
    startY: 40,
    columnStyles: {
      0: { columnWidth: 40 },
      1: { columnWidth: 80 },
      // 2: { columnWidth: 80 },
    },
  });

  // doc.autoPrint();
  doc.output('dataurlnewwindow');
  doc.save(`relatorio-financeiro-${new Date().getTime()}.pdf`);
}
